import React from "react";
import Label from "./Label";
import Input from "./Input";

const Form = ({ look, types }) => {
  return (
    <form className={look}>
      {types.map((type) => (
        <div class="mt-5">
          <Label type={type} />
          <div class="mt-5">
            <Input type={type} />
          </div>
        </div>
      ))}
    </form>
  );
};

export default Form;
